INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (40, "青空の下で謁見", 10118, 8, "ペコリーヌとの出会い", 1, 91002, "フリーマーケット会場", 0, 2834, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 2, 0, 5118061, 7);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (40, "未来の騎空団\nマスコット？", 10118, 8, "マホとの出会い", 1, 91002, "フリーマーケット会場", 0, 2835, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 2, 0, 5118062, 7);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (40, "お嬢さまからの\n緊急依頼", 10118, 8, "アキノとの出会い", 1, 91002, "ランドソル市街地", 0, 2837, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 2, 0, 5118063, 7);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (40, "黄金色の悩みごと", 10118, 8, "ジュンとの出会い", 1, 91002, "フリーマーケット会場", 0, 4108402, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 2, 0, 5118064, 18);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (40, "白熱！　格闘大会！", 10118, 8, "カオリとの出会い", 1, 91002, "フリーマーケット会場", 0, 4107402, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 2, 0, 5118065, 18);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (40, "祭り太鼓はオーエドの華", 10118, 8, "ニノンとの出会い", 1, 91002, "オーエド町", 1, 9000227, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 2, 0, 5118066, 16);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (40, "人気者は遅れて\nやってくる", 10118, 8, "スズナとの出会い", 1, 91002, "フリーマーケット会場", 0, 2101181, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 3, 0, 5118067, 19);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (40, "巫女・ミーツ・魔法少女", 10118, 8, "ナナカとの出会い", 1, 91002, "ランドソル市街地", 0, 4109402, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 3, 0, 5118068, 18);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (40, "ネズ耳は二度なくなる", 10118, 8, "キャル＆コッコロとの出会い", 1, 91002, "フリーマーケット会場", 0, 4305402, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 3, 0, 5118069, 18);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (40, "この出会いにカンパイ！", 10118, 8, "ユカリとの出会い", 1, 91002, "ランドソル市街地", 0, 4101402, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 3, 0, 5118070, 18);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (40, "陰陽アンサンブル", 10118, 8, "アオイとの出会い", 1, 91002, "ランドソル市街地", 0, 4106402, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 3, 0, 5118071, 18);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (40, "運試し十番勝負！", 10118, 8, "シノブとの出会い", 1, 91002, "フリーマーケット会場", 1, 2836, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 3, 0, 5118072, 7);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (0, "彼女たちの新たな日常", 10118, 0, "オープニング", 0, 0, 0, 0, 0, 0, 1, 10145115, 5118600, 0);
